(41, 192, 'Beauty Care Academy', 'Chinna Chokkikulam,Madurai.', '', 31, 137, 35, 3912, 20, 33, 'female', 1, 1, 'Front Office Executive', 'fresher', 2, 1, 'A front office executiveâ€™s responsibilities will vary based on the nature of the organization, but some central tasks are commonly a part of the job. Our analysis of listings reveals the following as duties usually expected of a front office executive:\n\n', 'Nageshwari', '2147483647', 106, 1, '2019-12-03 12:19:40'),
