(43, 197, 'Hotel Presidetn', '8 a yanikal Street Simmakla ', 'thehotelpresident.com', 31, 331, 35, 3912, 20, 30, 'any', 5, 5, 'Waiter / Waiteres ', 'experienced', 3, 1, 'Must be know the food menu knowledge \nIf Hindi Knowledge is preferred \nMust be star Hotel background \nCommunication skills in English and Hindi \n', 'Mubin', '2147483647', 14, 1, '2020-01-28 08:13:01'),
(44, 199, 'Blue Pearl Computer Education', 'Palanganatham, Madurai', 'www.bluepearl.co.in', 9, 302, 35, 3912, 19, 26, 'any', 3, 3, 'Trainer and Teacher', 'fresher', 2, 1, 'Computer related or complete any computer course students are apply.\nTeach a Basic computer and Programming for school/college students .', 'Raja', '2147483647', 155, 1, '2020-03-13 12:26:43'),
