(46, 206, 'Graphipackss Pvt. Ltd.', '163c/1, Kamarajar Salai, Madurai', 'www.graphipackss.in', 18, 2, 35, 3912, 25, 30, 'male', 1, 1, 'Accountant cum admin', 'experienced', 3, 1, '1. Must have rich experience in Tally.\n2. Must have knowledge in Manufactury and Factory Administration\n3. Must have worked in maintaining stock, ESi & PF and Salary Preparation', 'Arjun', '8220018100', 2, 1, '2020-09-15 04:40:57'),
(47, 206, 'Graphipackss Pvt. Ltd.', '163c/1, Kamarajar Salai, Madurai', 'www.graphipackss.in', 18, 184, 35, 3912, 25, 30, 'male', 1, 1, 'Marketing Executive', 'experienced', 3, 1, '1. Must have rich experience in product based marketing.\n2. Must have worked in Supplier for FMCG Products. \n3. Should handle Corporate Clients.', 'Arjun', '8220018100', 184, 1, '2020-09-15 04:40:57'),
(48, 206, 'Graphipackss Pvt. Ltd.', '163c/1, Kamarajar Salai, Madurai', 'www.graphipackss.in', 18, 104, 35, 3912, 25, 30, 'male', 1, 1, 'Digital Marketing Executive', 'experienced', 3, 1, '1. Must have rich experience in product based marketing.\n2. Must have handled FMCG Products. \n3. Should handle Corporate Clients.\n4. Should have experience in Twitter, Facebook, Instagram, Linkedin etc.', 'Arjun', '8220018100', 104, 1, '2020-09-15 04:40:57'),
