(50, 208, 'Veetukadai', 'No.24, E.B. Main road, muthuramalingapuram', 'www.veetukadai.co.in', 12, 101, 35, 3912, 25, 50, 'any', 5, 5, 'Delivery person for food delivery company', 'fresher', 2, 1, 'Persons responsible to pickup the food from restaurants and deliver it to the end customers\n\nHas to pay inr 1000 for bag and T-shirts will be provided for the same', 'Loganathan', '9150754160', 176, 1, '2020-10-05 05:22:27'),
(51, 211, 'N Kannalagan Company', '56, Tamil Sangam Road, Simmakkal, Madurai', 'www.kannalagan.com', 2, 275, 35, 3912, 20, 60, 'male', 2, 2, 'Sales Executive', 'experienced', 2, 1, 'Sales Executive for Truck or Lorry Spare Parts Company\n\nGood Knowledge in Lorry or Truck Spare Parts\n\nBasic Knowledge in Computer', 'Rajkumar', '9842150049', 275, 1, '2021-01-05 07:16:54'),
(52, 212, 'Virgo Engineering Works', 'ACHAMPATHU', 'virgofe.com', 10, 178, 35, 3912, 25, 35, 'male', 4, 4, 'Technician to manufacture and assemble food processing machineries', 'experienced', 3, 1, 'Wanted Skilled workers for manufacturing machineries', 'Nagarajan', '9894667943', 106, 1, '2021-01-19 12:02:49'),
(53, 238, 'Genn Infotech', 'R K Nagar, Behind Jaishanthi Theatre, Sinaganallur', 'www.genninfotech.com', 17, 290, 35, 3683, 25, 41, 'any', 3, 3, 'Asp.Net Developer (MVC)', 'experienced', 5, 1, 'We have an immediate requirement for a full stack .Net Developer as Junior/Senior Developer and Team Lead who has at least 1-5 years of experience\n\n•	Must have a strong understanding in OOPS concepts and integrating various APIs\n•	Must have a experience in C#, ASP.NET, MVC, JQuery and SQL Server \n•	Must have a Strong knowledge of web development including C#, ASP.NET, JavaScript, HTML, CSS, XML\n•	Knowledge of SDL and/or REST based web services and WCF would be a plus\n•	Knowledge of AngularJS and Node JS / React would be a plus\n\n1. Good knowledge on coding standards, design patterns, unit testing frameworks, TDD, CICD practices.\n\n2. Very good logical thinking and quick at learning and exploring new frameworks.\n\nApart from technical skills, some domain understanding in personal Industries (Textile / Engineering / Manufacturing Industries) would be a plus. \n\n\nSkill Set:\n Asp.Net, MVC, JQuery, SQL, OOPS, APIs, Software Development, Visual Studio, HTML 5, CSS3, C#, Entity framework, LINQ.', 'Gowtham', '7305020521', 290, 1, '2021-03-10 10:23:58');
